// import { faker } from "@faker-js/faker";
import {
  Image,
  Box,
  Breadcrumb,
  BreadcrumbItem,
  BreadcrumbLink,
  BreadcrumbSeparator,
} from "@chakra-ui/react";
import {ChevronRightIcon} from "@chakra"
import NatureImg from "../../Assets/temp-img/7.jpg";

const BannerComponent = () => {
  return (
    <>
      <Box mx="5%">
        <Image
          src={NatureImg}
          objectFit={"cover"}
          width="100vw"
          height={"50vh"}
          alt="banner"
        />
        <Breadcrumb
          spacing="8px"
          separator={<ChevronRightIcon color="gray.500" />}
        >
          <BreadcrumbItem>
            <BreadcrumbLink href="#">Home</BreadcrumbLink>
          </BreadcrumbItem>

          <BreadcrumbItem>
            <BreadcrumbLink href="#">About</BreadcrumbLink>
          </BreadcrumbItem>

          <BreadcrumbItem isCurrentPage>
            <BreadcrumbLink href="#">Contact</BreadcrumbLink>
          </BreadcrumbItem>
        </Breadcrumb>
      </Box>
    </>
  );
};
export default BannerComponent;
